import React from "react";
import Homepro from "./Homepro";
import {Route, Switch} from "react-router-dom";
 
const Mainpro = () =>{
    return(
        <>
        <Switch>
            <Route path="/" component={Homepro}/>
        </Switch>
    
        </>


    );
};
export default Mainpro;
